import React from "react";
import CardItem from "./CardItem";
import "./Cards.css";

function Cards() {
    return (
        <div class="container">
            <div class="card card0" to="/pools">
                <div class="border">
                    <h2 className="card0-h2">Pools</h2>
                </div>
            </div>
            <div class="card card1">
                <div class="border">
                    <h2>Landscapes</h2>
                </div>
            </div>
            <div class="card card2">
                <div class="border">
                    <h2>Tips</h2>
                </div>
            </div>
        </div>
    );
}

export default Cards;
